import React from 'react';
import { Grommet } from 'grommet';
const theme = {
    global: {
        font: {
            family: 'Roboto',
            size: '18px',
            height: '20px',
        },
    },
};
function App() {
  return (
      <Grommet theme={theme}>
      <header className="App-header">        
        <p>
          Edits <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
      </Grommet>
  );
}

export default App;
